o --></h5>\n\n        <!-- ko text: address().street --><!-- /ko -->\n        <!-- ko text: address().city --><!-- /ko -->, <!-- ko text: address().region --><!-- /ko --> <!-- ko text: address().postcode --><!-- /ko -->\n        <!-- ko text: getCountryName(address().countryId) --><!-- /ko -->,\n        <!-- ko text: address().telephone --><!-- /ko -->\n    </div>\n    <div class='actions'>\n        <!-- ko if: (address().isEditable() && !isFormPopUpVisible()) -->\n        <button type=\"button\"\n                class=\"action edit-address-link osc-edit-button\"\n                data-bind=\"click: editAddress, visible: address().isEditable()\">\n            <span data-bind=\"i18n: 'Edit'\"></span>\n        </button>\n        <!-- /ko -->\n    </div>\n    <div class='clear'></div>\n</div>\n","Magestore_OneStepCheckout/template/checkout/checkout-agreements.html":"<!--\n/**\n * Copyright \u00a9 2016 Magento. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div data-role=\"checkout-agreements\">\n    <div class=\"checkout-agreements\" data-bind=\"visible: isVisible\">\n        <!-- ko foreach: agreements -->\n            <!-- ko if: ($parent.isAgreementRequired($data)) -->\n            <div class=\"checkout-agreement\">\n                <input type=\"checkbox\"\n                       data-bind=\"attr: {\n                                    'id': 'agreement_' + agreementId,\n                                    'name': 'agreement[' + agreementId + ']',\n                                    'value': agreementId\n                                    }\"\n                       data-validate=\"{required:true}\" />\n                <label data-bind=\"attr: {'for': 'agreement_' + agreementId}\">\n                    <button type=\"button\"\n                            class=\"action action-show\"\n                            data-bind=\"click: function(data, event) { return $parent.showContent(data, event) }\"\n                            >\n          